import React, { useState } from 'react'
import '../../components/form/form.css'
const Form = () => {
  const [userDetails, setUserDetails] = useState({firstName: "",lastName: '',email: '',password: '',confirmPassword: ''}) 
  console.log(userDetails.firstName,userDetails.lastName,userDetails.email,user);
  
    const signInHander = (e) =>{
        e.preventDefault();

    }
    
  return (
    <main className="form-signin w-100 m-auto">
    <form onSubmit={signInHander}>

      
      <h1 className="h3 mb-3 fw-normal">Please sign in</h1>
      <div className="form-floating">
        <input type="text" className="form-control"  placeholder="name"
          onChange={(e)=>{setUserDetails({...userDetails, firstName:e.target.value})
          }
  
          }/>
        <label>First name</label>
      </div>
      
      <div className="form-floating">
        <input type="text" className="form-control mt-3" placeholder="name"  
        onChange={(e)=>{setUserDetails({...userDetails, lastName:e.target.value})
      }


        }/>
        <label >Last name</label>
      </div>
      
      
  
      <div className="form-floating">
        <input type="email" className="form-control"placeholder="name@example.com"
        onChange={(e)=>{setUserDetails({...userDetails, email:e.target.value})
      }


        }
        />
        <label>Email address</label>
      </div>
      <div className="form-floating">
        <input type="password" className="form-control" placeholder="Password"   
       onChange={(e)=>{setUserDetails({...userDetails, password:e.target.value})
      }


        }/>
        <label>Password</label>
      </div>
      <div className="form-floating">
        <input type="password" className="form-control" placeholder="Password"   
       onChange={(e)=>{setUserDetails({...userDetails, password:e.target.value})
      }


        }/>
        <label> Confirm Password</label>
      </div>
  
      <div className="form-check text-start my-3">
        <input className="form-check-input" type="checkbox" value="remember-me" id="flexCheckDefault"  
       onChange={(e)=>{setUserDetails({...userDetails, fconfirmPassword:e.target.value})
      }


        }/>
        <label className="form-check-label">
          Remember me
        </label>
      </div>
      <button className="btn btn-primary w-100 py-2" type="submit">Sign in</button>
    
    </form>
  </main>
   
  )
}
 export default Form;
